import '../css/page15.css';
import React from 'react'
import anime from "animejs";

function Page15(props){

  function animation(){
    anime.timeline().add({
      targets: '#Page15Node2',
      borderWidth: [0, 6],
      duration: 600,
      easing: "linear",
    })
  }
  if(props.display) animation();

  return(
      <div style={{display: props.display?'': 'none'}}>
        <text className="Page15NodeDes" id="Page15NodeDes1">
          <tspan> Node b<br/></tspan>
          <tspan> Term: 0</tspan>
        </text>
        <div className="Page15Node" id="Page15Node1"/>
        <text className="Page15NodeDes" id="Page15NodeDes2">
          <tspan> Node a<br/></tspan>
          <tspan> Term: 0<br/></tspan>
          <tspan> Vote Count: 0</tspan>
        </text>
        <div className="Page15Node" id="Page15Node2"/>
        <text className="Page15NodeDes" id="Page15NodeDes3">
          <tspan> Node c<br/></tspan>
          <tspan> Term: 0</tspan>
        </text>
        <div className="Page15Node" id="Page15Node3"/>
        <div id="Page15Signal1"/>
        <div id="Page15Signal2"/>
        <div className="Page15Text" id="Page15Text1"> The candidate then requests votes from other nodes. </div>
      </div>
  );
}

export default Page15;
